import React from "react";
import Fashions from "./Fashions";
import { Link } from "react-router-dom";

const Fashionshop = (props) => {
  return (
    <>
      {props.fashions.map((fashions, id) => (
        <Link to={`/blogs/${fashions.id}`} className="links">
          <Fashions key={id} fashions={fashions} />
        </Link>
      ))}
    </>
  );
};

export default Fashionshop;
